import React , {useEffect, useState} from 'react';
import Axios from 'axios';

export const Manager = ()=> {

    return (
        <div>
            <h2>Welcome Manager !!</h2>
            <Router>
                <Navbar/>
                    <hr></hr>
                <Routes>
                    <Route path = "/"  element = {<Home/>} />;
                    <Route path = "/Menu"  element = {<Menu/>} />;
                    <Route path = "/Contact"  element = {<Contact/>} />;
                </Routes>
            </Router>
        </div>
    );
}
